            dfs(i + 1, t + '(', lcnt + 1, rcnt, ldel, rdel)
        elif s[i] == ')':
            dfs(i + 1, t, lcnt, rcnt, ldel, rdel - 1)
            dfs(i + 1, t + ')', lcnt, rcnt + 1, ldel, rdel)
        else:
            dfs(i + 1, t + s[i], lcnt, rcnt, ldel, rdel)
