    for c in s:
        if c == '(':
            ldel += 1
        elif c == ')':
            if ldel == 0:
                rdel += 1
            else:
                ldel -= 1
    tdel = ldel + rdel
    ans = set()
    dfs(0, '', 0, 0, ldel, rdel)
    return list(ans)
